		/*
		
		This is the enemy class.  It will need to inherit the content of the game and the player
		in its construtor.  Think of it like this--it can't communicate with these other movieclips
		until they are nested within each other.  So putting constructor (content, player) is like 
		nesting these three clips together only with code.  That way the code can communicate with
		each object.
		
		see here for more info: https://developer.mozilla.org/en-US/docs/Web/JavaScript/Inheritance_and_the_prototype_chain
		
		"JavaScript is a bit confusing for developers experienced in class-based languages (like Java or C++), 
		as it is dynamic and does not provide a class implementation per se (the class keyword is introduced in ES2015, 
		but is syntactical sugar, JavaScript remains prototype-based).
		
		When it comes to inheritance, JavaScript only has one construct: objects. Each object has a private property 
		which holds a link to another object called its prototype. That prototype object has a prototype of its own, 
		and so on until an object is reached with null as its prototype. By definition, null has no prototype, and 
		acts as the final link in this prototype chain.
		
		Nearly all objects in JavaScript are instances of Object which sits on the top of a prototype chain."
		
		*/
		
		
		class Enemy {
			
			constructor(content, player, enemyType, enemyHitNum) //here is where we are inheriting content & player--or joining them through code
			{
				this.content = content;  //sets up an abstract content object (movieclip) to hold content
				this.player = player;  //sets up an abstract player object (movieclip) to hold player
				this.movie = new lib.enemy();//adds the enemy
				
				this.enemyType = enemyType;
				this.movie.gotoAndStop(enemyType);
				
				this.enemyHitNum = enemyHitNum;
				
				this.content.addChild(this.movie);  //notice it adds this to movie with the player so that they all are connected.
				this.speed = 2.5; //enemies got its own speed
				this.isDie = false;// it isn't dead
				this.toDelete = false;//it isn't deleted
			}
			
			update() { //here we use the enemies update to start moving it
				if (this.isDie) return;//if it is dead don't go further
				
			
				var dx = this.player.movie.x - this.movie.x; 
				var dy = this.player.movie.y - this.movie.y;
				var angle = Math.atan2(dy , dx);
				
				this.movie.x += Math.cos(angle) * this.speed;
				this.movie.y += Math.sin(angle) * this.speed;
				
				this.movie.rotation = angle * 180 / Math.PI;
				
				/*
				Here we use a variation of the pythagorean theorem.  We set dx & dy
				equal to this player's x in the movie movieclip (remember we keep it local
				to the coordinates in movie) to the enemies x & Y in the movie movieclip
				Remember that we set both the player and enemeis in the movie movieclip 
				so we have to reference them there.  
				
				Next we get the angle using Math.atan2 to our dy & dx so that we can know 
				what angle we need to orient the enemy toward the player
				
				Then we rotate the enemy toward the player
		
				
				*/
				
		
				if (!this.player.movie.hit._off) //check to see if the player is not hitting anyone currently
				{
					var pl = this.movie.localToLocal(0 , 0 , this.player.movie.hit);//set the pl variable to check for hits against the player & enemy
					if (this.player.movie.hit.hitTest(pl.x , pl.y)) //if the player & the enemy connect 
					{
						//THIS.CURRENTHITS++;
						///*CHECKING IF ENOUGH HITS TO KILL*/
						//if(THIS.HITNUMTOKILL == THIS.CURRENTHITS){
						//this.movie.gotoAndPlay("hit");//tell the enemy to play its hit animation
						this.isDie = true; //the enemy is dead
						
						stage.SCORE += 10; //create a score
						this.content.txt_score.text = stage.SCORE;//add the score to dynamic textbox
						
						createjs.Tween.get(this) //already explained in the player--basically a timer for letting the animation run & then resetting.
							.wait(500)
							.call(function() {
								this.toDelete = true;
							}
							.bind(this));
						//}else{	// NOT ENOUGH HITS TO KILL ENEMY SO DO NOTHING?
						//	
						//}
					}
				}
			
				if (!this.player.movie.collision._off) //here is how we kill the player
				{
					var pl = this.movie.localToLocal(0 , 0 , this.player.movie.collision);//looks to see if the enemy has collided with the nested collision movieclip in the player
					if (this.player.movie.collision.hitTest(pl.x , pl.y)) //if the enemy has collided with the nested collision movieclip then
					{
						if (!this.player.isDie) //make sure the player isn't already dying (in case multiple enemies connecting at once)
						{
							this.player.die();//contact the player class and tell it to run the die() function --this is why we inherit the player in constructor
							this.movie.visible = false;//get rid of this enemy as the player fades out.
						}
					}
				}
				
		
			}
			
			clear() 
			{
				
				this.content.removeChild(this.movie);//here we contact the content movieclip (also through the constructor) and tell it to get rid of this enemy
			}
			
			
		}
		this.stop();
		var root = this;
		
		/*
		
		The game class is for orgainzing things like start menus & hud
		it only inherits content in its constructor because it has
		no need to connect to the player or enemy directly--but can 
		simply connect through the content movieclip which contains 
		all other elements 
		
		*/
		
		
		class Game {
		
			constructor(content) //inherits or connects with content
			{
					console.log("GAME IS RUNNING");
				this.content = content;//nests or instantiates content within itself
				this.player = new Player(content , this); //says it will make an oject equal to the player in content
				this.content.on("tick" , this.update.bind(this));//here is where we set the tick and connect all the updates to it
				this.enemies = [];//create an array for multiple enemies to be stored within it
		
				this.skip = new Skip(content,this);
				
				createjs.Tween.get(this , {loop:-1} ) //like the other class objects this is meant as a timer for calling various functions at certain times--in this case when to add enemies
					.wait(800) //how long to wait before calling code below
					.call(function() {  //a function reaching out to the other class objects and functions within them
						var enemyTypeNum = Math.floor(Math.random() * 6);// GENERATES RANDOM NUM 0-5
						var enemyHitNum = Math.floor(Math.random() * 4);
						var enemy = new Enemy(this.content , this.player, enemyTypeNum, enemyHitNum); //creates a variable enemy that loads & communicates with the enemy object connected with the player in content
						enemy.movie.x = 350 + (Math.random() * 400);//sets the enemy wandering on a x axis
						enemy.movie.y = Math.random() * 500;
						
						//enemy.movie.y = (Math.random() < 0.5)? -50 : 450;// sets the enemy wandering on an y axis with the bounds of 450 for y stage value
						this.enemies.push(enemy);// pushes the enemy into the array.  Remember that each enemy has its own instructions in the enemy class for what to do (chase the player)
					}.bind(this));
					
				this.isEndGame = false;// game hasn't ended so let's play
				stage.SCORE = 0;//initialize the score
				
			}
			
			update(e) //run the update on the tick
			{
				if (this.isEndGame) return; //if the game is ended return that & stop
				
				this.player.update(); //otherwise call the update function in the player so it starts moving
				for (var i = this.enemies.length -1; i >= 0; i--) //do a loop to see how many enemies you have in the array
				{
					if (this.enemies[i].toDelete) //if one of the enemies has been killed an its delete function is called then
					{
						this.enemies[i].clear();//call the enemy clear function and get rid of it
						this.enemies.splice(i , 1);//remove it from the array
					}
					else //if the enemy isn't killed
					{
						this.enemies[i].update();//call the enemy update function and get it moving 
					}
					
				}
			}
			
			gameOver() {  //what to do if the game is over
				this.isEndGame = true;// game has ended
			
				createjs.Tween.get(this) //here is a timer to call reset
					.wait(500)
					.call(function() {
						this.player.clear();//get rid of the player
						//this.content.parent.changePage(new lib.mc_over()); //call up the game over movieclip
						root.gotoAndStop(17);
					}.bind(this));
			}
		
		}
		
		window.Game = new Game(this);//reset the game in the browser
		
		
		
		
		
